// Libs
import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

// Components
import ImageLogo from '../../../components/ImageLogo';
import Input from '../../../components/Input';
import Button from '../../../components/Button';
import ResetPasswordCodeScreen from './ResetPasswordScreen';


class PasswordResetScreen extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			value: '',
			email: '',
			password: '',
			type: 'password',
		};
	}

	handleChangeNumber = (ev) => {
		this.setState({
			number: ev.target.value,
		});
	};

	handleChangePassword = (ev) => {
		this.setState({
			password: ev.target.value,
		});
	}

	render() {
		console.log(this.state.email);
		return (
			<ContainerForm>
				<Form onSubmit={this.handleSubmit}>
					<ImageLogo />
					<InputBox>
						<Label>CONFIRMATION CODE</Label>
						<Input
							login
							// type="email"
							onChange={this.handleChangeNumber}
							placeholder="Insert here the code"
						/>
					</InputBox>
					<InputBox>
						<Label>NEW PASSWORD</Label>
						<Input
							login
							type={this.state.type}
							onChange={this.handleChangePassword}
							placeholder="Insert here the code"
						/>
					</InputBox>
					<InputBox>
						<Label>REPEAT NEW PASSWORD</Label>
						<Input
							login
							type={this.state.type}
							onChange={this.handleChangePassword}
							placeholder="Insert here the code"
						/>
					</InputBox>
					<Button
						login
						text="PROCEED WITH NEW PASSWORD"
						type="submit"
					/>
					<Span>
						<ButtonText>RESEND EMAIL</ButtonText>
					</Span>
				</Form>
			</ContainerForm>
		);
	}
}

export default PasswordResetScreen;
